import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./components/Home/Home";
import Create from "./components/Create/Create";
import Edit from "./components/Edit/Edit";
import SuggestionPage from "./components/SuggestionPage/SuggestionPage";
import Container from "./components/UI/Container/Container";
import Auth from "./components/Auth/Auth";
import ProjectRoadmap from "./components/Home/Header/Menu/ProjectRoadmap/ProjectRoadmap";

function App() {
  return (
    <Router>
      <Container>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/auth" element={<Auth />} />
          <Route path="/create-feedback" element={<Create />} />
          <Route path="/edit-feedback/:id" element={<Edit />} />
          <Route path="/view-suggestion/:id" element={<SuggestionPage />} />
          <Route path="/project-roadmap/" element={<ProjectRoadmap />} />
        </Routes>
      </Container>
    </Router>
  );
}

export default App;
